import React from 'react';

const content = ({tweetdata}) =>{
  const style = {
    width:"20px",
    height: "20px"  
  };
  return (
    <div  className="column middle">
      {
        tweetdata.map(item => (
          <div >
            <div><img src={item.image} style={style}/>        <b> {item.name} </b>   {item.tweetid}</div>
            <br/>
            <div>{item.content}</div> 
            <div>
              <p>
                <img src="Comments Image" alt="Comments"/>
                <img src="Tweet Image" alt="Re Tweet"/>  
                <img src="message Image" alt="like"/> 
              </p>
            </div>           
          </div>
          ))
      }


    </div>
    )
}

export default content
